    [],nt"num_tags": 9,nt"name": "final-comprehensive-conservation-plan-and-environmental-impact-statement-little-pend-oreil",nt"isopen":
    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Little Pend Oreille NWR for the next 15 years.
    This plan outlines the Refuge vision and purpose and describes how Little Pend Oreille
    NWR will contribute to the overall mission of the Refuge System. The plan provides
    an introduction to the Refuge, an overview of the CCP process, goals and objectives,
    alternatives, a description of the affected environment, environmental consequences,
    and consultation with others. Key planning issues include: habitat protection and
    restoration, recreation, grazing, Air Force training, and the role of the Refuge
    in the regional economy.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
